import React from 'react'

//styles
import "./recipeList.css"


export default function RecipeList({recipes}) {
  return (
    <div className='recipe-list'>
      RecipeList
      {recipes.map((recipe) => (
        <div key={recipe.id} className=''>
            <h2 key={recipe.id}>{recipe.title}</h2>
        </div>
      ))}
    </div>
  )
}
